import React, { useEffect, useState } from 'react';
import { getAllDoctors } from '../api/doctorApi';
import { Link } from 'react-router-dom';

interface Doctor {
  id: number;
  firstName: string;
  lastName: string;
  email: string;
  phone: string;
  photoUrl: string;
  profile: {
    education: string;
    experience: string;
    bio: string;
    specialization: string;
    price: number;
    rating: number | null;
  };
}

const DoctorsPage = () => {
  const [doctors, setDoctors] = useState<Doctor[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        const response = await getAllDoctors();
        setDoctors(response.data);
        setLoading(false);
      } catch (err) {
        setError('Не вдалося завантажити лікарів');
        setLoading(false);
      }
    };

    fetchDoctors();
  }, []);

  if (loading) return <div>Завантаження...</div>;
  if (error) return <div>{error}</div>;

  return (
    <div className="max-w-[1650px] lg:max-w[1400] mx-auto px-4 py-8">
      <h1 className="text-center text-3xl 2xl:text-4xl font-bold mb-10">Лікарі</h1>
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-8 justify-items-center">
        {doctors.map((doctor) => (
          <div
            key={doctor.id}
            className="w-full md:max-w-[540px] lg:max-w-[640px] 2xl:max-w-[745px] 
                      h-auto md:min-h-[400px] lg:min-h-[480px] 2xl:min-h-[520px] 
                      bg-white rounded-xl border-2 border-primary shadow-xl 
                      p-4 lg:p-5 2xl:p-6 flex flex-col justify-between"
          >
            {/* Top Section */}
            <div className="flex flex-col md:flex-row gap-6">
              <div className="flex flex-col items-center">
                <img
                  src={doctor.photoUrl}
                  alt={`${doctor.firstName} ${doctor.lastName}`}
                   className="w-[160px] h-[160px] md:w-[180px] md:h-[180px] lg:w-[200px] lg:h-[200px] 2xl:w-[220px] 2xl:h-[220px] rounded-full border-2 border-primary object-cover"
                />
                <div className="mt-3 flex gap-1">
                  {[...Array(5)].map((_, i) => (
                    <span
                      key={i}
                      className={`text-accent text-[20px] lg:text-[22px]  2xl:text-[25px] ${i < (doctor.profile.rating || 0) ? '' : 'opacity-30'}`}
                    >
                      ★
                    </span>
                  ))}
                </div>
              </div>

              <div className="flex-1 ml-0 xl:ml-4">
                <h2 className="text-[22px] lg:text-[25px] 2xl:text-[28px] font-bold text-primary">
                  {doctor.firstName} {doctor.lastName}
                </h2>
                <p className="text-[22px] lg:text-[25px]  2xl:text-[28px] text-primary font-bold mt-2 xl:mt-3">
                  {doctor.profile.specialization}
                </p>
                <div className="w-full lg:max-w-[330px] 2xl:w-[410px] h-[2px] bg-primary mt-2 2xl:mt-3 mb-4 2xl:mb-6"></div>
                <p className="text-[14px] xl:text-[16px] font-inter font-medium text-primary">
                  {doctor.profile.bio}
                </p>
              </div>
            </div>

            {/* Review Section */}
            <div className="bg-primary text-background rounded-xl p-4 lg:p-5 mt-4">
              <div className="flex justify-between items-center">
                <div className="font-roboto font-bold text-base lg:text-lg xl:text-xl tracking-[1px]">
                  Андрій Ковальчук
                </div>
                <div className="flex items-center gap-1">
                  {[...Array(5)].map((_, i) => (
                    <span key={i} className="text-accent text-[20px] lg:text-[22px] 2xl:text-[25px]">★</span>
                  ))}
                </div>
              </div>
              <p className="font-playfair italic font-light text-sm lg:text-base mt-2">
                Відгук від користувача, який може бути на 2–3 рядки. Можна скоротити або зробити кнопку "читати більше".
              </p>
            </div>

            {/* Bottom Section */}
            <div className="flex flex-col lg:flex-row justify-between items-center gap-4 mt-4">
              <p className="text-primary text-[22px] lg:text-[24px] 2xl:text-[26px] font-semibold">
                Від: {doctor.profile.price} грн
              </p>
              <Link
                to={`/doctors/${doctor.id}`}
                className="bg-primary w-full lg:w-[150px] 2xl:w-[225px] h-[50px] lg:h-[55px] 2xl:h-[60px] hover:bg-blue-800 transition text-background font-roboto font-bold text-[20px] 2xl:text-[28px] rounded-lg flex items-center justify-center"
              >
                Записатися
              </Link>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DoctorsPage;
